import React, { useState } from "react";

import {
  MDBBtn,
  MDBCol,
  MDBContainer,
  MDBModal,
  MDBModalDialog,
  MDBModalContent,
  MDBModalHeader,
  MDBIcon,
  MDBInput,
  MDBModalTitle,
  MDBModalBody,
  MDBModalFooter,
  MDBRow,
} from "mdb-react-ui-kit";

import Box from "@mui/material/Box";
import SpeedDial from "@mui/material/SpeedDial";
import SpeedDialIcon from "@mui/material/SpeedDialIcon";
import SpeedDialAction from "@mui/material/SpeedDialAction";

function TransactionSpeedDial(props) {
  // Delete Modal State
  const [deleteModal, setDeleteModal] = useState(false);

  function toggleShowDeleteModal() {
    setDeleteModal(!deleteModal);
  }

  // Hier Delete-Request an DB
  // Transaktions-ID ist 'props.id'
  function deleteTransaction() {
    console.log(props.id);
  }

  // Edit Modal State
  const [editModal, setEditModal] = useState(false);

  function toggleShowEditModal() {
    setEditModal(!editModal);
  }

  // In die Funktion Post-Request fÃ¼r aktualisierte Beschreibung
  // Beschreibung ist 'description' ; Transaktions-ID ist 'props.id'
  const [description, setDescription] = useState(props.title);

  function handleSubmit(e) {
    e.preventDefault();
  }

  return (
    <div>
      <Box className="float-end">
        <SpeedDial
          ariaLabel="SpeedDial"
          icon={<SpeedDialIcon />}
          direction="down"
        >
          <SpeedDialAction
            key="edit"
            icon={<MDBIcon fas icon="edit" size="lg" />}
            tooltipTitle="Bearbeiten"
            tooltipOpen
            onClick={toggleShowEditModal}
          />
          <SpeedDialAction
            key="delete"
            icon={<MDBIcon fas icon="trash-alt" size="lg" />}
            tooltipTitle="Entfernen"
            tooltipOpen
            onClick={toggleShowDeleteModal}
          />
        </SpeedDial>
      </Box>

      {/* Delete Modal */}
      <MDBModal show={deleteModal} setShow={setDeleteModal} tabIndex="-1">
        <MDBModalDialog>
          <MDBModalContent>
            <MDBModalHeader>
              <MDBModalTitle>Auftrag entfernen</MDBModalTitle>
              <MDBBtn
                className="btn-close"
                color="none"
                onClick={toggleShowDeleteModal}
              ></MDBBtn>
            </MDBModalHeader>
            <MDBModalBody>
              Wollen sie den Auftrag <b>"{props.title}"</b> wirklich entfernen?
              Dieser Vorgang lÃ¤sst sich nicht rÃ¼ckgÃ¤ngig machen.
            </MDBModalBody>

            <MDBModalFooter>
              <MDBBtn color="danger" onClick={toggleShowDeleteModal}>
                Nicht entfernen
              </MDBBtn>
              <MDBBtn outline color="danger" onClick={deleteTransaction}>
                Entfernen
              </MDBBtn>
            </MDBModalFooter>
          </MDBModalContent>
        </MDBModalDialog>
      </MDBModal>

      {/* Edit Modal */}
      <MDBModal show={editModal} setShow={setEditModal}>
        <MDBModalDialog>
          <MDBModalContent>
            <MDBModalHeader>
              <MDBModalTitle>Auftrag umbenennen</MDBModalTitle>
              <MDBBtn
                className="btn-close"
                color="none"
                onClick={toggleShowEditModal}
              ></MDBBtn>
            </MDBModalHeader>
            <MDBModalBody>
              <MDBContainer>
                <form onSubmit={handleSubmit}>
                  <MDBInput
                    name="description"
                    label="Beschreibung der Transaktion"
                    type="text"
                    className="mt-2"
                    onChange={(e) => setDescription(e.target.value)}
                    value={props.title}
                  />
                  <MDBRow>
                    <MDBBtn type="submit" color="success" className="mt-4 mb-2">
                      Speichern
                    </MDBBtn>
                  </MDBRow>
                </form>
              </MDBContainer>
            </MDBModalBody>

            <MDBModalFooter>
              <MDBBtn color="danger" onClick={toggleShowEditModal}>
                Abbrechen
              </MDBBtn>
            </MDBModalFooter>
          </MDBModalContent>
        </MDBModalDialog>
      </MDBModal>
    </div>
  );
}

export default TransactionSpeedDial;
